    const layerSource = new Source(url2, {
      parser: {
        type: 'rasterTile',
        tileSize: 256,
      },
    });
    const layer1 = new RasterLayer({
      zIndex: 1,
    }).source(layerSource);

    const layer2 = new RasterLayer({
      zIndex: 2,
    }).source(annotion, {
      parser: {
        type: 'rasterTile',
        tileSize: 256,
        zoomOffset: 0,
      },
    });

    const boundsLayer = new PolygonLayer({
      zIndex: 10,
    })
      .source(emptyPolygon)
      .shape('line')
      .size(2)
      .color('#f00')
      .style({
        opacity: 1,
      });

    scene.on('loaded', () => {
      setScene(scene);
      setSource(layerSource);
      scene.addLayer(layer1);
      scene.addLayer(layer2);
      scene.addLayer(boundsLayer);
      setExtentLayer(boundsLayer);

      scene.on('click', (e) => {
        const lngLat = e.lngLat;
        console.log(lngLat);

        const point = tileHelper.lngLatToPixels(
          lngLat.lng,
          lngLat.lat,
          Math.ceil(scene.getZoom()),
        );
        setMapClick(point);
      });
    });
